import React from 'react';
import ReactDOM from 'react-dom';

import './index.css';

import {
	BrowserRouter as Router,
	Switch,
	Route,
	Link,
  BrowserRouter
} from "react-router-dom";


import App from './App.jsx';
import Error4040 from './Components/Pages/Error404'

ReactDOM.render(
  <BrowserRouter>
    <Router>
      <Switch>
        <Route path="/" component={App} />
        <Route path="*" component={Error4040} />
      </Switch>
    </Router>,
  </BrowserRouter>,

  document.getElementById('root')
);
